description:
On The Gate!  A podcast hosted by two reformed jailbirds/drug addicts and active comedians Geo Perez and Derek Drescher, join them as they talk each week about their times in jail, on drugs, what they learned, what you should know, and how they are improving their life each day or slipping into recidivism/relapse.

Geo Perez
@geoperez86

Derek Drescher
@derekdrescher

Brought to you by Derek Drescher & Geo Perez
